import cover_image from '../assets/cover_image.jpg'

const colors = {
    primary: "#060606",
    background: "#E0E0E0", 
    disabled: "#D9D9D9"
}

const Login = () => {
    return (
        <div className='w-full min-h-screen flex items-start' style={{ backgroundColor: colors.background }}>
            <div className='relative w-1/2 h-full flex flex-col'>
                <img src={cover_image} className="w-full h-full" style={{ borderColor: colors.primary }} />
            </div>
            <div className='w-1/2 h-full flex flex-col justify-center' style={{ backgroundColor: colors.primary }}>
                <h1 className='text-white text-4xl'>Login Page</h1>
            </div>
        </div>
    )
}

export default Login;
